column208:
Satzprozedur, kombiniert aus mehreren Modulen, zum Satz gepflegter Typograhie mit anspruchsvollem Layout, komplexer Editionen mit mehreren Apparaten, Vielsprachigkeit incl. griechisch, hebräisch etc.; Registerherstellung mit eigenen Sortieralphabeten; eigene Projektbezogene Prüfroutinen;
Plattformunabhängiges, kollaboratives Arbeiten möglich;
professionelle PS-Ausgabe; Verlag schätzt sehr die Qualität der Daten.
